-- Drop existing tables if exists
DROP TABLE IF EXISTS seer_performance CASCADE;
DROP TABLE IF EXISTS customer_potential CASCADE;
DROP TABLE IF EXISTS knowledge_category CASCADE;

-- ============================================================================
-- CREATE TABLES
-- ============================================================================

-- Knowledge Category Table
CREATE TABLE knowledge_category (
category_id VARCHAR(36) PRIMARY KEY,
name VARCHAR(255) NOT NULL,
description TEXT,
created_at TIMESTAMP,
updated_at TIMESTAMP
);

-- Customer Potential Table (Training AI Version)
CREATE TABLE customer_potential (
customer_full_name VARCHAR(255) NOT NULL,
customer_email VARCHAR(255) NOT NULL,
customer_profile_description TEXT,
customer_birth_date TIMESTAMP,
customer_gender VARCHAR(10),
month INT NOT NULL CHECK (month BETWEEN 1 AND 12),
year INT NOT NULL,
potential_point INT NOT NULL,
potential_tier VARCHAR(20) NOT NULL, -- CASUAL, STANDARD, PREMIUM, VIP
ranking INT NOT NULL,
total_booking_requests INT NOT NULL DEFAULT 0,
total_spending NUMERIC(15, 2) NOT NULL DEFAULT 0,
cancelled_by_customer INT NOT NULL DEFAULT 0,
PRIMARY KEY (customer_email, month, year)
);

-- Seer Performance Table (Training AI Version)
CREATE TABLE seer_performance (
seer_full_name VARCHAR(255) NOT NULL,
seer_email VARCHAR(255) NOT NULL,
seer_profile_description TEXT,
seer_birth_date TIMESTAMP,
seer_gender VARCHAR(10),
seer_speciality TEXT[], -- Array of speciality names
month INT NOT NULL CHECK (month BETWEEN 1 AND 12),
year INT NOT NULL,
performance_tier VARCHAR(20) NOT NULL, -- APPRENTICE, PROFESSIONAL, EXPERT, MASTER
performance_point INT NOT NULL,
ranking INT NOT NULL,
total_packages INT NOT NULL DEFAULT 0,
total_rates INT NOT NULL DEFAULT 0,
avg_rating NUMERIC(3, 2) NOT NULL DEFAULT 0,
total_bookings INT NOT NULL DEFAULT 0,
completed_bookings INT NOT NULL DEFAULT 0,
cancelled_by_seer INT NOT NULL DEFAULT 0,
total_revenue NUMERIC(15, 2) NOT NULL DEFAULT 0,
bonus NUMERIC(15, 2) NOT NULL DEFAULT 0,
PRIMARY KEY (seer_email, month, year)
);

-- Create indexes for better query performance
CREATE INDEX idx_customer_potential_email ON customer_potential(customer_email);
CREATE INDEX idx_customer_potential_month_year ON customer_potential(month, year);
CREATE INDEX idx_customer_potential_tier ON customer_potential(potential_tier);
CREATE INDEX idx_seer_performance_email ON seer_performance(seer_email);
CREATE INDEX idx_seer_performance_month_year ON seer_performance(month, year);
CREATE INDEX idx_seer_performance_tier ON seer_performance(performance_tier);

-- Disable triggers and constraints for faster import
SET session_replication_role = 'replica';

